import React, { useEffect, useState } from 'react'
import DogCard from '../search/DogCard'
import { getDataFromLocalStorage } from '../../utilities/getDataFromLocalStorage'
import '../../stylesheets/saved_dogs.scss'

const MyDogs = () => {
  const [dogs, setDogs] = useState([])

  useEffect(() => {
    const myDogs = getDataFromLocalStorage('dogs') | []
    setDogs(myDogs)
  }, [])

  return (
    <div className='dogs_archive'>
      {
        dogs.map(dog => <DogCard key={dog.img} dog={dog} />)
      }
    </div>
  )
}

export default MyDogs
